					assetTitle
					completionTimeMetric {
						value
					}
					submissionsMetric {
						value
					}
					urls
					viewsMetric {
						value
					}
				}
			}
			total
		}
	}

name:
addDXPCloudEnvironment(
		$DXPCloudEnvironment: InputC_DXPCloudEnvironment!
	)

content:
{
		users(
			channelId: $channelId
			keywords: $keywords
			size: $size
			sort: $sort
			start: $start
		) {
			dxpEntities {
				id
				name
				... on User {
					dataSourceName
					screenName
				}
			}
			total
		}
	}

{
		pageAssets(
			keywords: $keywords
			propertyFilters: $propertyFilters
			size: $size
			sort: $sort
			start: $start
		) {
			pageAssets {
				canonicalUrl
				description
				keywords {
					type
					value
				}
				id
				title
				url
			}
			total
		}
	}

name:
addAnalyticsCloudWorkspace(
		$analyticsCloudWorkspace: InputC_AnalyticsCloudWorkspace!
	)

content:
{
		page(
			channelId: $channelId
			canonicalUrl: $touchpoint
			country: $location
			deviceType: $devices
			rangeEnd: $rangeEnd
			rangeKey: $rangeKey
			rangeStart: $rangeStart
			title: $title
		) {
			viewsMetric {
				...browserFragment
				...deviceFragment

				previousValue
				value
			}
		}
	}

	${BROWSER_FRAGMENT}
	${DEVICE_FRAGMENT}

{
  user: mergeUser(fromId: $fromId, toId: $toId, chatbotId: $chatbotId) {
    id,
    username,
    userId,
    first_name,
    last_name,
    username,
    language,
    payload,
    createdAt,
    email,
    chatIds {
      id,
      transport,
      chatId
    }
  }
}

{
        activeTree @client {
            id @client
            behavior @client
            libraries @client {
                id @client
                behavior @client
            }
            label @client
            permissions @client {
                access_tree @client
                edit_children @client
            }
        }
    }

{
    createRider(
        riderInput:$riderInput
    ){
    _id
    name
    username
    password
    phone
    available
    }
  }

{
		eventAnalyses(
			channelId: $channelId
			keywords: $keywords
			page: $page
			size: $size
			sort: $sort
		) {
			eventAnalyses {
				... on EventAnalysis {
					dateModified: modifiedDate
					id
					name
					userName: createdByUserName
				}
			}
			total
		}
	}

{queryTabsName(name)}(
		$assetId: String!
		$channelId: String
		$devices: String
		$location: String
		$rangeEnd: String
		$rangeKey: Int
		$rangeStart: String
		$title: String
		$touchpoint: String
	) {
		${name}(
			assetId: $assetId
			canonicalUrl: $touchpoint
			channelId: $channelId
			country: $location
			deviceType: $devices
			rangeEnd: $rangeEnd
			rangeKey: $rangeKey
			rangeStart: $rangeStart
			title: $title
		) {
			${assetMetricFragment(metrics)}
		}
	}

	${METRIC_TABS_FRAGMENT}

{
		blogs(
			channelId: $channelId
			keywords: $keywords
			rangeEnd: $rangeEnd
			rangeKey: $rangeKey
			rangeStart: $rangeStart
			size: $size
			sort: $sort
			start: $start
		) {
			assetMetrics {
				... on BlogMetric {
					assetId
					assetTitle
					commentsMetric {
						value
					}
					ratingsMetric {
						value
					}
					readingTimeMetric {
						value
					}
					urls
					viewsMetric {
						value
					}
				}
			}
			total
		}
	}

{
		form(
			assetId: $assetId
			canonicalUrl: $touchpoint
			channelId: $channelId
			country: $location
			deviceType: $devices
			rangeEnd: $rangeEnd
			rangeKey: $rangeKey
			rangeStart: $rangeStart
			title: $title
		) {
			abandonmentsMetric {
				...metricFragment
			}
			assetId
			assetTitle
			completionTimeMetric {
				...metricFragment
			}
			submissionsMetric {
				...browserFragment
				...deviceFragment
				...geolocationFragment
				...metricFragment
			}
			urls
			viewsMetric {
				...metricFragment
			}
		}
	}

	${BROWSER_FRAGMENT}
	${DEVICE_FRAGMENT}
	${GEOLOCATION_FRAGMENT}
	${METRIC_FRAGMENT}

{
    allVCompanyAdminMonths(filter: { groupId: { equalTo: $groupId } }) {
      nodes {
        year
        id
        month
        groupId
        amountFeedbacks
      }
    }
  }

{
        libraries(filters: {id: $id}) {
            list {
                id
                label(lang: $lang)
                gqlNames {
                    query
                    filter
                }
                attributes {
                    id
                    type
                    format
                    label(lang: $lang)
                }
            }
        }
    }

{
        createPosts(
            input: [
                {
                    title: $title
                    content: $content
                    blog: { connect: { where: { id: $blog } } }
                    author: { connect: { where: { id: $user } } }
                }
            ]
        ) {
            posts {
                id
            }
        }
    }

{
    message(order_by: { id: desc }, limit: 1) {
      id
      username
      text
      timestamp
    }
  }

{
    allHeadlines(first: 42, offset: $offset, orderBy: CREATED_AT_DESC) {
      nodes {
        id
        createdAt
        link
        thumbnail
        title
      }
      totalCount
    }
  }
